INSERT INTO `study_protocols` VALUES (1,1,5,1,NULL,'Entry','Materials','Define the materials used in this study, both those for investigation, the vehicle, controls etc','','Web','',2,'','2007-03-20 19:50:48','','2007-03-21 14:27:23'),(2,1,5,2,NULL,'Entry','Animals','Assign animals to treatment groups, recording their age and weight.  Animals should be over 40 days old and weigh 200g','','Spreadsheet','',1,'','2007-03-20 20:05:26','','2007-03-20 20:05:26'),(3,1,5,3,NULL,'Entry','Treatments','Treatment group definition','','Web','',1,'','2007-03-20 20:09:03','','2007-03-20 20:09:03'),(4,1,6,4,NULL,'Entry','Weights','Track the weights of the individual animals over a number of days','','Spreadsheet','',2,'','2007-03-20 20:54:26','','2007-03-20 20:55:11'),(5,1,8,5,NULL,'Entry','Weight Summary','Plot mean and SD for each treatment group','','Spreadsheet','',1,'','2007-03-20 21:00:33','','2007-03-20 21:00:33'),(6,1,6,6,NULL,'Entry','Taqman Readings','Gene expression reading','','Spreadsheet','',3,'','2007-03-20 21:15:22','','2007-03-20 21:20:28'),(7,1,8,7,NULL,'Entry','Taqman Analysis','Run statistical analysis over Taqman readings and generate probability scores.  Progress Groups that are significantly different from control to histological analysis ','','Web','',1,'','2007-03-20 21:22:37','','2007-03-20 21:22:37'),(8,1,6,8,NULL,'Entry','Histological Scoring','Score lung slices for symptoms','','Web','',1,'','2007-03-20 21:31:18','','2007-03-20 21:31:18'),(9,2,5,9,NULL,'Entry','Setup Materials and Groups','Preparation step where the investigator defines the materials under investigation and the size of the treatment groups','','Web','',1,'','2007-03-21 09:51:33','','2007-03-21 09:51:33'),(10,2,6,10,NULL,'Entry','Capture Raw Data','8 animals per group\n','','Spreadsheet','',2,'','2007-03-21 10:07:13','','2007-03-24 16:26:31'),(11,2,8,11,NULL,'Entry','ED50 Calculation','Take raw data, normalise it and generate an ED50','','Spreadsheet','',1,'','2007-03-21 10:32:26','','2007-03-21 10:32:26'),(12,2,5,12,NULL,'Entry','Brain Plasma Assessment','Plasma samples\r\nThe plasma samples should be taken into K3EDTA tubes and centrifuged at 10-15 min. at 2000 G (5C)\r\nStore the samples in polypropylene tubes (order no.M32022, Micronic, In vitro A/S)\r\nThe tubes should be closed with a break-off capband (order no. M82605, Miconic, In Vitro A/S)\r\nA minimum of 200 L plasma is required\r\nPlace the samples systematically in a rack (order no. M22504, Micronic, In Vitro A/S)\r\n\r\nBrain samples\r\nWhole brain samples should be weigh out and stored in 12 mL tubes from VWR International (Article No. BDAA352059)\r\nFor mice the whole brain should be used and for rats  brain should be used \r\nThe brains should be weighed out and taken down at this sampleinfo\r\nLabel all tubes with labels from Cils (40 x17 mm, cat.no. E45-A8735), please ask for the wordtemplate\r\nALL samples should be labelled with information of study no., dose, group no., time (nominel) and compound no.\r\nStore the samples at -80C\r\n\r\nIf actual time is considerable different from nominel time please write the actual time after dosing  \r\nplease send this infosheet to the mailbox: exposure\r\n','','Protocol','',1,'','2007-03-21 11:21:53','','2007-03-21 11:21:54'),(13,4,5,16,NULL,'Entry','Test_Compounds','new protocol created for study Test','','Protocol','',2,'','2007-03-30 19:55:06','','2007-03-30 19:59:34'),(14,4,5,17,NULL,'Entry','Test_Sex','new protocol created for study Test','','testing','',1,'','2007-03-30 19:58:35','','2007-03-30 19:58:35'),(15,1,8,18,NULL,'Entry','Histology Summary','new protocol created for study Biomarker And Histology','','Protocol','',2,'','2007-03-30 22:45:04','','2007-03-30 22:45:09'),(16,3,5,19,NULL,'Entry','Develop Assay','This is an interesting protocol as in this case, the output of the process is the collection of protocols and SOPs used in the study.  The output will be to an asset, usually a word document describing the assay.  There may be some secondary protocol used for calculation of assay robustness for example.\r\n','','Asset','',1,'','2007-04-03 19:26:33','','2007-04-03 19:26:33'),(17,3,5,20,NULL,'Entry','Single Point 384','Run screening collection through screen and identify hits for confirmation. Plate size is set at 384.','','Automation','',4,'','2007-04-03 20:43:41','','2007-04-03 21:06:12'),(18,3,5,21,NULL,'Entry','Single Point 96','Used for small scale runs and confirmation assays','','Automation','',1,'','2007-04-03 20:59:54','','2007-04-03 20:59:54'),(19,3,5,22,NULL,'Entry','Dose Response','Dose response assay returning an IC50 or max inhibition and dose','','Automation','',1,'','2007-04-03 21:08:08','','2007-04-03 21:08:08'),(20,3,8,23,NULL,'Entry','Screen Report','Write screen report for Assay.  This includes all the plate quality statistics, the hit progression and the final hit list of compounds..','','Report','',1,'','2007-04-03 21:34:27','','2007-04-03 21:34:27');
